         >
            X
         </button>
         <p>{props.name}</p>
         <p>{props.status}</p>
         <p>{props.species}</p>
         <p>{props.gender}</p>
         <p>{props.origin.name}</p>
         <img
            src={props.image}
            alt={props.name}
            className={style.img}
         />
      </div>
   );
}
